CREATE TABLE Details (id INT, URL varchar(255), ImgURL varchar(255), Title varchar(255), Brand varchar(255), Model varchar(255), Price varchar(255), Mileage varchar(255), Year varchar(255), Horsepower varchar(255), Fuel varchar(255), Color varchar(255), Origincolor varchar(255), Paint varchar(255), SellerName varchar(255), SellerPhone varchar(255));
